import { RouterProvider } from 'react-router-dom';
import './App.css';
import { HomePage } from './pages/HomePage/HomePage';
import { router } from './routes/Router';
import { Provider } from 'react-redux';

function App() {
  return (
    <Provider>
      <RouterProvider router={router} />
    </Provider>
  );
}

export default App;
